import React from "react";
import "../index.css";

function SignIn() {

    return(
        <div className="sm:max-w-[358] flex flex-col px-4 gap-5">
           <h1>CREATE ACCOUNT</h1>
            <div></div>
            <form>
            <input className="block border m-3" type="text"  placeholder="First Name" />
            <input className="block border m-3" type="text"  placeholder="Last Name" />
            <input className="block border m-3" type="email" placeholder="Email" />
            <input className="block border m-3" type="text"  placeholder="Address 1" />
            <input className="block border m-3" type="text"  placeholder="Address 2" />
            <input className="block border m-3" type="text"  placeholder="City" />
            <input className="block border m-3" type="text"  placeholder="Province" /><input type="number" placeholder="Postal Code" />
            <input className="block border m-3" type="text"  placeholder="Store Name" />
            <input className="block border m-3" type="checkbox"  /> Keep me up to date on news and exclusive offers
            <input type="submit" value="Submit" />









            </form>
        </div>





    )
}


export default SignIn;
